import logo from './logo.svg';
import './App.css';
import { Layout, Menu } from 'antd';

const { Header } = Layout;

function App() {
  return (
    <div className="App">
      <Header>
      <div className="logo" />
      <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['1']}>
        <Menu.Item key="1">Trang chủ </Menu.Item>
        <Menu.Item key="2">Thông báo </Menu.Item>
        <Menu.Item key="3">Quy định</Menu.Item>
        <Menu.Item key="4">Quy định</Menu.Item>
        <Menu.Item key="3">Quy định</Menu.Item>

      </Menu>
    </Header>
    </div>
  );
}

export default App;
